    - ¡DotaPy se renueva!
    - Nuevo sitio, nuevas características, nuevas oportunidades.
    - "<p>Sean todos bienvenidos al renovado sitio de DotaPy! Durante los &uacute;ltimos
      meses, estuvimos trabajando en mejorar nuestro sitio web anterior, tanto en
      lo visual como en las caracter&iacute;sticas del mismo. Ten&iacute;amos planeado
      lanzarlo reci&eacute;n en abril, pero estaba quedando tan bien que ya no pod&iacute;amos
      esperar m&aacute;s :)</p>\r\n<p>Entre los cambios que encontrar&aacute;n resalta,
      obviamente, nuestro <strong>nuevo dise&ntilde;o</strong>. Tambi&eacute;n les
      hacemos la carga de noticias m&aacute;s f&aacute;cil a nuestros administradores,
      as&iacute; que <strong>esperamos ver m&aacute;s noticias en esta web</strong>.&nbsp;En
      esta nueva versi&oacute;n, adem&aacute;s, agregamos una caracter&iacute;stica
      muy interesante, que esperamos sea del agrado de todos ustedes: el <strong>R&aacute;nking
      DotaPy</strong>. Les sugiero que vayan a revisarlo.</p>\r\n<p>Las sorpresas
      de DotaPy para este a&ntilde;o a&uacute;n no acaban, obviamente. Tenemos planeado
      unos cuantos eventos interesantes m&aacute;s. Por lo tanto, aseg&uacute;rense
      de revisar tanto esta web como <a href=\"http://fb.me/DotaPy.oficial\" target=\"_blank\">nuestra
      p&aacute;gina de Facebook</a>&nbsp;regularmente para estar enterados de todo.</p>\r\n<p>Sin
      nada m&aacute;s que agregar, de vuelta, sean todos bienvenidos. Les traeremos
      m&aacute;s noticias y m&aacute;s acci&oacute;n de Dota 2 pr&oacute;ximamente.</p>\r\n<p>Saludos
      a todos.</p>"
