    - Anunciamos el Ránking DotaPy
    - Un nuevo emprendimiento para todos ustedes. Participa en nuestros lobbies, escala
      posiciones y demuestra quién es el mejor!
    - "<p>&iquest;En qu&eacute; consiste el R&aacute;nking DotaPy? B&aacute;sicamente,
      vamos a crear lobbys p&uacute;blicos,&nbsp;a los que la gente va a poder ingresar
      y participar de una partida. Al finalizar la misma,&nbsp;<strong>almacenaremos
      las estad&iacute;sticas y mantendremos actualizado un r&aacute;nking general
      y otros r&aacute;nkings para carries, supports, midders y offlaners</strong>.
      No es genial?</p>\r\n<p>El r&aacute;nking se actualizar&aacute; cada semana,
      y esperamos hacer al menos 2 partidas por semana. Estaremos avisando por la
      fanpage de Facebook el d&iacute;a y la fecha del siguiente lobby v&aacute;lido
      para el r&aacute;nking.</p>\r\n<p>Ahora, como requisito, necesitamos que los
      participantes <strong>inicien&nbsp;sesi&oacute;n con su cuenta de Steam</strong>
      en este sitio (haciendo click al bot&oacute;n verde en la cabecera). Una vez
      que lo hayan hecho, ya podr&aacute;n participar del r&aacute;nking, y para comenzar,
      les daremos 2000 puntos. Cada victoria otorga 20 puntos, y cada derrota resta
      20 puntos.</p>\r\n<p>Para ver el reglamento del torneo, <a href=\"/rules/reglamento-ranking.pdf\"
      target=\"_blank\">haz click aqu&iacute;</a>.</p>\r\n<p>Esperamos verlos en el
      r&aacute;nking. Vamos a descubrir a los mejores ;)</p>"
    - anunciamos-el-ranking-dotapy
