    - Cambios en el Ránking DotaPy
    - Tras 11 lobbies jugados entre el domingo y el lunes (y las sugerencias de muchos
      jugadores), hemos decidido realizar algunos cambios y explicar algunas cuestiones
      reglamentarias.
    - "<h3>Horarios</h3>\r\n<p>Los lobbies tendr&aacute;n, de ahora en m&aacute;s,
      un horario y una cantidad fija. Sabemos que no todos pueden en ciertos horarios,
      y sabemos que los lobbies se llenan enseguida&nbsp;y lastimosamente no podemos
      atenderlos a todos. Sin embargo, por cuestiones de organizaci&oacute;n, debemos
      limitarnos en la cantidad&nbsp;de los mismos. Los nuevos horarios ser&iacute;an:</p>\r\n<ul>\r\n<li><strong>Viernes</strong></li>\r\n<ul>\r\n<li>18:00
      (2&nbsp;lobbies)</li>\r\n<li>22:00 (2&nbsp;lobbies)</li>\r\n</ul>\r\n<li><strong>S&aacute;bado</strong></li>\r\n<ul>\r\n<li>21:00
      (2&nbsp;lobbies)</li>\r\n<li>22:00 (2 lobbies)</li>\r\n<li>23:00 (3 lobbies)</li>\r\n<li>00:00
      (3 lobbies)</li>\r\n</ul>\r\n<li><strong>Domingo</strong></li>\r\n<ul>\r\n<li>18:00
      (3 lobbies)</li>\r\n<li>21:00 (3 lobbies)</li>\r\n</ul>\r\n</ul>\r\n<p>Los horarios
      son tentativos (cualquier modificaci&oacute;n la informaremos en la <a href=\"http://fb.me/DotaPy.oficial\">fanpage</a>),
      pero apuntamos a crear <strong>20 lobbies v&aacute;lidos por fin de semana</strong>.</p>\r\n<p>&nbsp;</p>\r\n<h3>Requisitos
      para&nbsp;participar</h3>\r\n<p>Aqu&iacute; hay una actualizaci&oacute;n respecto
      a lo que establece el reglamento. Para participar de un lobby v&aacute;lido
      para el r&aacute;nking, el jugador debe cumplir estos requisitos:</p>\r\n<ul>\r\n<li>Ser
      paraguayo y/o residente de Paraguay.&nbsp;Esto incluye:</li>\r\n<ul>\r\n<li>Ser
      paraguayo y vivir en Paraguay.</li>\r\n<li>Ser paraguayo de nacimiento, pero
      actualmente viviendo en el extranjero.</li>\r\n<li>Ser extranjero pero viviendo
      en Paraguay.</li>\r\n<ul>\r\n<li>Se considerar&aacute;n casos de extranjeros
      que hayan vivido un tiempo en Paraguay.</li>\r\n</ul>\r\n</ul>\r\n<li>Haber
      iniciado sesi&oacute;n&nbsp;con su cuenta de Steam en&nbsp;<a href=\"/\">http://dotapy.com/</a></li>\r\n<li>No
      haber jugado m&aacute;s de 2&nbsp;lobbies rankeados en un mismo d&iacute;a (3
      lobbies rankeados si es s&aacute;bado).</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>Balanceo
      de equipos</h3>\r\n<p>Por las pr&oacute;ximas 3 semanas, estaremos confiando
      en el balanceo de equipos autom&aacute;tico propio de Dota 2, ya que es el tiempo
      en el que calculamos que veremos diferencias significativas en el r&aacute;nking.
      Una vez que transcurran estas 3 semanas, utilizaremos el R&aacute;nking de DotaPy
      para dividir los lobbies y organizar los equipos de acuerdo al puntaje.</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<h3>Modos
      de juego</h3>\r\n<p>Salvo indicaci&oacute;n de&nbsp;la administraci&oacute;n
      de DotaPy, el modo de juego del lobby ser&aacute; sometido a votaci&oacute;n,
      y puede ser uno de los siguientes:</p>\r\n<ul>\r\n<li>Elecci&oacute;n libre
      rankeada</li>\r\n<li>Todos aleatorio</li>\r\n<li>Modo capit&aacute;n</li>\r\n<li>Menos
      jugados</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>Penalizaciones y denuncias</h3>\r\n<p>Si
      deseas denunciar a un jugador t&oacute;xico durante una partida de lobby, le
      solicitamos al afectado&nbsp;realizar la denuncia por mensaje en la <a href=\"http://fb.me/DotaPy.oficial\">fanpage</a>&nbsp;o
      hablando directamente con el admin de la sala (en lo posible, proporcionando
      evidencia fotogr&aacute;fica) para poder tomar acci&oacute;n si es necesario.
      De cualquier forma, los administradores de sala tienen la potestad de penalizar
      autom&aacute;ticamente, previa notificaci&oacute;n.</p>\r\n<p>Una penalizaci&oacute;n
      descuenta puntos en el r&aacute;nking. La escala es la siguiente:</p>\r\n<ul>\r\n<li><strong>Denuncia
      menor:</strong> 5 puntos</li>\r\n<li><strong>Denuncia intermedia:</strong> 10
      puntos</li>\r\n<li><strong>Denuncia grave:</strong> 15 puntos</li>\r\n</ul>\r\n<p>As&iacute;
      mismo, tambi&eacute;n se penaliza el abandono.</p>\r\n<ul>\r\n<li><strong>M&aacute;s
      de 5 minutos desconectado:</strong> 20 puntos</li>\r\n<ul>\r\n<li>Incluso si
      el desconectado vuelve m&aacute;s adelante.</li>\r\n</ul>\r\n<li><strong>Abandono
      inmediato:</strong> 40 puntos</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>Criterios
      de desempate</h3>\r\n<p>OBS: todos los criterios son de mayor a menor salvo
      especificado lo contrario.</p>\r\n<ul>\r\n<li><strong>Para el r&aacute;nking
      general:</strong> Score, partidas jugadas (menor a mayor), victorias, derrotas
      (menor a mayor), kills, deaths (menor a mayor), assists, last hits, denies,
      top GPM, top XPM.</li>\r\n<li><strong>Para el r&aacute;nking de carries:</strong>
      Score, partidas jugadas (menor a mayor), victorias, derrotas (menor a mayor),
      kills, assists, deaths (menor a mayor), last hits, top GPM, top XPM, denies.</li>\r\n<li><strong>Para
      el r&aacute;nking de supports:</strong> Score, partidas jugadas (menor a mayor),
      victorias, derrotas (menor a mayor), assists, deaths (menor a mayor), kills,
      denies, last hits, top XPM, top GPM.</li>\r\n<li><strong>Para el r&aacute;nking
      de midders:</strong> mismo criterio del r&aacute;nking general.</li>\r\n<li><strong>Para
      el r&aacute;nking de offlanes:</strong> mismo criterio del r&aacute;nking general.</li>\r\n</ul>\r\n<p>&nbsp;</p>"
