    - DotaPy en el Next Gen Py Internacional 2015
    - DotaPy tendrá su espacio durante este evento a realizarse el 3 y el 4 de octubre
      en el local de la Ampande, y estamos planeando algo súper interesante.
    - "<p>Adem&aacute;s de hacer presencia en el evento con un stand tem&aacute;tico
      a Dota 2 <span style=\"text-decoration: line-through;\">y conocer a nuestro
      staff (?)</span>,&nbsp;vamos a realizar <strong>un showmatch en vivo con los
      mejores jugadores del R&aacute;nking DotaPy</strong> el s&aacute;bado 3 de octubre
      (horario a confirmar). La partida podr&aacute; verse en vivo en las pantallas
      gigantes del lugar y, posiblemente, en vivo por internet.</p>\r\n<p>Los 10 mejores
      jugadores del r&aacute;nking en la semana anterior al evento ser&aacute;n los
      elegidos para participar. &iquest;No est&aacute;s a&uacute;n en el R&aacute;nking
      DotaPy? &iexcl;&iquest;Qu&eacute; est&aacute;s esperando?! Registrate&nbsp;en
      la web con tu cuenta de Steam y estate atento a la <a href=\"http://fb.me/DotaPy.oficial\"
      target=\"_blank\">p&aacute;gina de Facebook</a>&nbsp;los fines de semana para&nbsp;participar
      de los lobbies v&aacute;lidos para el r&aacute;nking.</p>\r\n<h3>Qu&eacute;
      es el Next Gen Py Internacional?</h3>\r\n<p>Es un evento de caracter internacional
      a realizarse el 3 y el 4 de octubre,&nbsp;y se llevar&aacute;n a cabo&nbsp;torneos
      de Mortal Kombat X, Ultra Street Fighter IV, Super Smash Bros., Killer Instinct,
      Soul Calibur, Tekken Tag Tournament y m&aacute;s, con la presencia de top players
      de pa&iacute;ses como Argentina,&nbsp;Bolivia, Brasil y Chile.</p>\r\n<p>El
      evento est&aacute; organizado por la comunidad <strong>Next Gen Py</strong>
      con el apoyo de <strong>ETC Chile</strong> y <strong>Hadouken Dojo Gamer</strong>,
      especialistas internacionales en la organizaci&oacute;n de eventos gamers, quienes
      garantizan 2 d&iacute;as&nbsp;alucinantes a puro gaming!</p>\r\n<p>Adem&aacute;s
      de los torneos habr&aacute;n m&aacute;s cosas como stands comerciales, video
      game music, zona retro, espacio exclusivo para ni&ntilde;os, presencia las 24
      horas para LAN parties y muchas novedades m&aacute;s.</p>\r\n<p>DotaPy est&aacute;
      orgulloso de participar en este evento y ya no podemos esperar&nbsp;a que llegue
      el d&iacute;a! Los esperamos a todos en la <a href=\"https://www.google.com.py/maps/place/AMPANDE/@-25.26744,-57.56896,17z/data=!3m1!4b1!4m2!3m1!1s0x945da6115fb1504f:0xb6ec4d84b4989e14?hl=es-419\"
      target=\"_blank\">Ampande</a>&nbsp;el 3 y el 4 de octubre, no falten ;)</p>\r\n<p>Para
      m&aacute;s informaci&oacute;n sobre el evento, <a href=\"https://www.facebook.com/events/912640285424005/\"
      target=\"_blank\">hagan click aqu&iacute;</a>.</p>\r\n<p>&nbsp;<img style=\"display:
      block; margin-left: auto; margin-right: auto;\" src=\"/images/2/adapted.png?1427550931\"
      alt=\"Next Gen Py\" width=\"652\" height=\"504\" /></p>"
